import React from 'react';

function Navigation() {
    return (
      <nav style={{ display: "flex", justifyContent: "flex-end" }}>
        <p className="f5 link dim ba b--white-40 br2 ph3 pv2 mh4 mv2 pointer">Sign Out</p>
      </nav>
    );
}

export default Navigation;
